// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Repository.sol";

contract UserTable {
  event NewRecord(address indexed addr, uint256 indexed githubId);

  address public admin;

  constructor(address _admin){
    admin = _admin;
  }
  function addRecord(address addr, uint256 githubId, uint8 v, bytes32 r, bytes32 s) public {
    bytes memory message = abi.encodePacked(addr, githubId);
    bytes32 msgHash = keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n52", message));

    require(admin == ecrecover(msgHash, v, r, s));
    require(msg.sender == addr);

    emit NewRecord(addr, githubId);
  }
}

contract RepoTable {
  event NewRecord(address indexed addr, uint256 indexed githubId);

  address public admin;

  constructor(address _admin){
    admin = _admin;
  }
  function addRecord(address addr, uint256 githubId, uint8 v, bytes32 r, bytes32 s) public {
    bytes memory message = abi.encodePacked(addr, githubId);
    bytes32 msgHash = keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n52", message));

    require(admin == ecrecover(msgHash, v, r, s));
    require(Repository(addr).isRepository() == true);
    require(Repository(addr).owner() == msg.sender);

    emit NewRecord(addr, githubId);
  }
}
